import React from 'react';
import logosolo2 from './logosolo2.png';

const Cabecera = () => {
return (

  <header>
    <div classNameName="db dt-l w-100 border-box pa3 ph5-l">
        <div className="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l">
            <a href="https://github.com/" ><img alt='logo' classNameName="ph4 dib br2 br--top " src={logosolo2} /></a>
        </div>
        <div className="db dtc-l v-mid w-100 tc tr-l">
            <a className="f6 dib  bg-animate hover-bg-white hover-pink no-underline pv2 ph4 mh2 br-pill  " href="https://www.google.com">About</a>
            <a className="f6 dib  bg-animate hover-bg-white hover-pink no-underline pv2 ph4 mh2 br-pill ba " href="https://www.google.com">Contacto</a>
            <a className="f6 dib  bg-animate hover-bg-white hover-pink no-underline pv2 ph4 mh2 br-pill ba " href="https://www.google.com">Blog</a>
        </div>


    </div>
  </header>

);
}

export default Cabecera;
